from pybricks.hubs import PrimeHub
from pybricks.parameters import Axis, Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

from p_turn import p_turn_incremental_async

# Set up all devices.
prime_hub = PrimeHub(top_side=Axis.Z, front_side=Axis.X)
left = Motor(Port.F, Direction.COUNTERCLOCKWISE)
right = Motor(Port.E, Direction.CLOCKWISE)
left_attachment = Motor(Port.D, Direction.CLOCKWISE)
right_attachment = Motor(Port.C, Direction.COUNTERCLOCKWISE)
drive_base = DriveBase(left, right, 62.4, 110)

async def p_turn_increment_mma(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 20)

async def subtask():
    await wait(200)
    drive_base.settings(straight_speed=100)
    await drive_base.straight(127, then=Stop.NONE)

async def subtask2():
    drive_base.settings(straight_speed=800)
    await drive_base.straight(700)

async def subtask3():
    await wait(500)
    await left_attachment.run_angle(5000, 1100)

async def mma_run():
    await wait(0)
    prime_hub.imu.reset_heading(0)
    drive_base.use_gyro(True)
    drive_base.settings(straight_speed=300)
    drive_base.settings(straight_acceleration=750)
    await drive_base.straight(720)
    await p_turn_increment_mma(90)
    await drive_base.straight(357)
    await p_turn_increment_mma(-90)
    drive_base.settings(straight_speed=150)
    await drive_base.straight(-85)
    await right_attachment.run_angle(200, 300)
    drive_base.settings(straight_speed=75)
    await drive_base.straight(25)
    await right_attachment.run_angle(1000, -270)
    await wait(500)
    await right_attachment.run_angle(1000, -30)
    await drive_base.straight(-25)
    await right_attachment.run_angle(200, 300)
    await drive_base.straight(25)
    await multitask(
        right_attachment.run_angle(1000, -280),
        subtask(),
    )
    drive_base.settings(straight_speed=50)
    await drive_base.straight(70)
    await left_attachment.run_angle(1000, -1300)
    await wait(100)
    await left_attachment.run_angle(1000, 1300)
    drive_base.settings(straight_speed=200)
    await drive_base.straight(-100)
    await p_turn_increment_mma(-70)
    drive_base.settings(straight_speed=400)
    await drive_base.straight(250)
    await left_attachment.run_angle(1000, -1100)
    await drive_base.straight(100)
    await p_turn_increment_mma(-67)
    await drive_base.straight(100)
    await p_turn_increment_mma(-35)
    await multitask(
        subtask2(),
        subtask3(),
    )
    drive_base.stop()

async def main():
    await mma_run()


run_task(main())